import { useState } from "react";
import axios from 'axios'
import './Loginpage'
import {Link} from 'react-router-dom'
function Dashboard(){
    const[dataRetrive,setdataRetrive]=useState([])
    const[DataEnquiry,setDataEnquiry]=useState([])

    const retriveprocess=()=>{
        axios.post('http://localhost:5001/RetriveData')
        .then((res)=>{
           setdataRetrive(res.data.result)
        })
        .catch((error)=>{
            console.log(error);
            
        })
    }

    const enquiryprocess=()=>{
        axios.post('http://localhost:5001/enquiryData').then((res)=>{
            setDataEnquiry(res.data.result)
        })
    }

    return(
        <div>
            <center>
                <h1 className="bg-blue-500 text-white p-8 text-center text-xl">View Lists</h1>
                <button className='bg-blue-500 text-white px-4 py-2 rounded' onClick={retriveprocess}>User Data</button>
                <button className='bg-blue-500 text-white mx-4 px-4 py-2 rounded' onClick={enquiryprocess}>Enquiry Data</button>
                <Link className="bg-green-500 text-white px-4 mx-4 py-2 rounded" to='/'><button>Login</button></Link>
                {
                    dataRetrive.length>0 && 
                    <>
                    <table className="mt-3">
                        <thead>
                            <tr>
                                {
                                    Object.keys(dataRetrive[0]).map((key)=>(
                                        <th key={key}>{key.toUpperCase()}</th>
                                    ))
                                }
                            </tr>
                        </thead>
                        <tbody>
                                {dataRetrive.map((row,index)=>(
                                    <tr key={index}>
                                        {Object.values(row).map((values,i)=>(
                                            <td key={i}>{values}</td>
                                        ))}
                                    </tr>
                                ))}
                        </tbody>
                    </table>
                    </>
                }
                {
                    DataEn
                }
            </center>
        </div>
    )
}
export default Dashboard
